import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import HomePage from './Pages/HomePage';
import AboutPage from './Pages/AboutPage';
import BlogPage from './Pages/BlogPage';
import GalleryPage from './Pages/GalleryPage';
import ShopPage from './Pages/ShopPage';
import ContactPage from './Pages/ContactPage';
import Navbar from './Components/Navbar';
import LoginPage from './Pages/LoginPage';
import SignUp from './Pages/SignUp';

function App() {
  // Assuming you're checking if a token exists in localStorage to determine if the user is logged in
  const isLoggedIn = localStorage.getItem('authToken') !== null;

  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginPage />} />
        <Route path="/signup" element={<SignUp />} />

        <Route path="/" element={<Navbar />}>
          {/* Conditionally render HomePage or redirect to Login if not logged in */}
          <Route path="/homepage" element={isLoggedIn ? <HomePage /> : <Navigate to="/" />} />
          <Route path="/about" element={<AboutPage />} />
          <Route path="/blogs" element={<BlogPage />} />
          <Route path="/gallery" element={<GalleryPage />} />
          <Route path="/shop" element={<ShopPage />} />
          <Route path="/contact" element={<ContactPage />} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
